        category: 9,
        topic: 'DESIRED FOODS',
        slug: 'desired-foods',
        description: '<p><strong>VEGETABLES-</strong> Green Leafy Vegetables (Soko, Ugu, Tete, Gbure, Uziza, Utazi, Scent leave, Curry leave, Oha leave, Lettuce, Cabbage, Spinage, Ewedu, Carrots, bitter leave, Garden egg, Mushrooms, Onions, Cucumber, Runner beans etc,&nbsp;</p><p><strong>FRUITS-</strong> Grapefruit, Pawpaw, African Cherry (Agbalumo, Udala), Cashew, Garden Egg (Agba), Nnmimi (pepper fruit), etc</p><p><strong>WATER –</strong> More than 2 litres a day</p><p><strong>BEVERAGES-</strong> Coffee, Tea (tea bags) without sugar</p><p><strong>CONDIMENTS-</strong> Pepper, Curry, Thyme, Iru, Garlic, Ginger</p>',
        photo: null,
        timestamp: 1590069729,
